import Link from "next/link";

const Navbar = () => (
  <nav className="navbar">
    <div>
      <ul>
        <li>
          <Link href="/">
            <a>Home</a>
          </Link>
        </li>
        <li>
          <Link href="/portfolio">
            <a>Portfolio</a>
          </Link>
        </li>
        <li>
          <Link href="/contact">
            <a>Contact</a>
          </Link>
        </li>
        <li>
          <Link href="blog">
            <a>Blog</a>
          </Link>
        </li>
      </ul>
      <style jsx>{`
        .navbar {
          float: right;
        }

        .navbar div ul {
          list-style: none;
          padding: 0px;
        }

        .navbar li {
          padding: 5px;
          display: inline;
        }

        .navbar a {
          color: black;
          text-decoration: none;
          font-size: 18px;
          padding-right: 15px;
        }

        .navbar a:hover {
          color: red;
        }
      `}</style>
    </div>
  </nav>
);

export default Navbar;
